//N
function WidthCheck(s, n){   
	    var w = 0;   
	    for (var i=0; i<s.length; i++) {   
	       var c = s.charCodeAt(i);   
	       //1   
	       if ((c >= 0x0001 && c <= 0x007e) || (0xff60<=c && c<=0xff9f)) {   
	      w++;   
	      }   
	      else {   
	     w+=2;   
	      }   
	   }   
	   if (w > n) {   
	     return false;   
	  }   
	  return true;   
}


